import React from 'react';
import { Navi } from "react-router-dom"

function Dashboard({ authorized }) {

    if (!authorized) {
        return <Redirect to="/login"/>
    }
    return(
        <div>Hello Dashboard</div>
    )
}

export default Dashboard;
